===============

Installing DotLiquid
--------------------

{% highlight text %}
paket add nuget DotLiquid
paket add nuget Suave.DotLiquid
{% endhighlight %}

How to use liquid from Suave.
-----------------------------

{% highlight fsharp %}
open Suave
open Suave.DotLiquid
open DotLiquid

type Model =
  { title : string }

setTemplatesDirectory "./templates"

let o = { title = "Hello World" }

let app =
  choose
