	if (a == 0) {
		if (b == 0) {
			if (c == 0) {
				cout << -1 << endl;
			} else {
				cout << 0 << endl;
			}
		} else {
			cout << 1 << endl << fixed << setprecision(10) << -c / b << endl;
		}
	} else {
		if (a < 0) {
			a = -a;
			b = -b;
			c = -c;
		}
		d = b * b - 4 * a * c;
		if (d < -1e-8) {
			cout << 0 << endl;
		} else {
			d = sqrt(fabs(d));
			if (d < 1e-8) {
				cout << 1 << endl << fixed << setprecision(20) << -b / (2 * a) << endl;
			} else {
				cout << 2 << endl;
				cout << fixed << setprecision(20) << (-b - d) / (2 * a) << endl;
				cout << fixed << setprecision(20) << (-b + d) / (2 * a) << endl;
			}
		}
	}

	return 0;
}

