namespace Common
{

Thread::Thread(std::function<void()> f, ThreadObserver * observer)
  : Observer(observer)
  , Func(f)
  , Impl(Thread::ThreadProc, this)
{
}

Thread::~Thread()
{
  try
    {
      Join();
    }

  catch (std::exception &)
    {
    }
}

void Thread::Join()
{
  Impl.join();
}

void Thread::Run()
{
  try
    {
      Func();

      if (Observer)
        {
          Observer->OnSuccess();
        }
    }

  catch (const std::exception & exc)
    {
      if (Observer)
        {
          Observer->OnError(exc);
        }
    }
}

void Thread::ThreadProc(Thread * thread)
{
  thread->Run();
}

