bool gao(int n, double R, double r) {
    if (r > R) {
        return false;
    } else if (n == 1) {
        return true;
    } else if (r > R / 2) {
        return false;
    } else {
        r = asin(min(1.0, r / (R - r)));
        // printf("%.2lf %.2lf\n", r, n * r);
        return n * r <= PI + EPS;
    }
}

